import Header from "../../header/Header";
import "./AllRestaurants.scss";
import BeigeCard from "../../layout/card/BeigeCard";
import NavLinkTemplate from "../../layout/button/NavLinkTemplate";
import { Fragment } from "react";
import Footer from "../../footer/Footer";
import RestaurantsGrid from "./RestaurantsGrid";
import React from 'react';
import {connect} from 'react-redux'
import {addData} from '../../../store/action';


const AllRestaurants:React.FC<{addData: any, data:any}>= (props) => {
  return (
    <Fragment>
      <Header />
      <h2>Restaurants</h2>
      <nav>
       <NavLinkTemplate to={'/AllRestaurants'} content={'All'}></NavLinkTemplate>
       <NavLinkTemplate to={'/New'} content={'New'}></NavLinkTemplate>
       <NavLinkTemplate to={'/MostPopular'} content={'Most Popular'}></NavLinkTemplate>
       <NavLinkTemplate to={'/OpenNow'} content={'Open Now'}></NavLinkTemplate>
      </nav>
      {addData.payload.map((item) => {return (<BeigeCard
          title={item.restaurantName}
          detail={item.chefName}
          img={item.restaurantImage}
        ></BeigeCard>)})}

      <Footer />
    </Fragment>
  );
};
const mapStateToProps=(state: { data: any; })=>({ data:state.data })

const mapDispatchToProps = (dispatch: (arg0: { type: string; payload: any; }) => any) => {
  return {
    addData: ()=> dispatch(addData)
  }
}
export default connect(mapStateToProps,mapDispatchToProps)(AllRestaurants);
